// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

// Contract for DevFee
contract AdminFee {
    address public admin;
    address public token; // Token address

    constructor(address _token) {
        admin = msg.sender;
        token = _token;
    }

    function setToken(address _token) public onlyAdmin {
        token = _token;
    }

    // function for updating admin only can be updated by the admin
    function updateAdmin(address _admin) external {
        require(_admin != address(0), "Invalid address");
        require(msg.sender == admin, "Only admin can perform this action");
        admin = _admin;
    }

    // function to withdraw token only by admin
    function withdraw(uint256 amount) external onlyAdmin {
        require(msg.sender == admin, "Only admin can perform this action");
        IERC20(token).transfer(msg.sender, amount);
    }

    // Modifier only admin
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }
}

contracts/FaucetToken.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract FaucetToken {
    IERC20 public token;
    uint256 public currentAirdropAmount;

    constructor(address _token) {
        token = IERC20(_token);
    }

    function claimTokens(address recipient, uint256 amount) external {
        currentAirdropAmount += amount;
        token.transfer(recipient, amount);
    }
}

contracts/Swapper.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Swapper is Ownable {
    address public token;

    constructor(address _token) Ownable(msg.sender) {
        token = _token;
    }

    function swap(address _user, uint256 _value) public onlyOwner {
        IERC20(token).transfer(_user, _value);
        emit Swapped(_user, _value);
    }

    function setTokenAddress(address _token) public onlyOwner {
        token = _token;
    }

    event Swapped(address indexed user, uint256 value);
}

